import '../App.css';
import 'react-router-dom'

function Nav() {
  return (
    <nav>
        <h3>Routing</h3>
        <ul className="nav-links">
            <li><a href="/about">About</a></li>
            <li><a href="/shop">Shop</a></li>
        </ul>
    </nav>
  );
}

export default Nav;
